import React, {useState} from 'react';
import {View, TouchableOpacity, Text, Image} from 'react-native';
import {canvas} from "../styles/styles";
import RNImageTools from "react-native-image-tools-wm";

function MergeImages(bookId, pageId) {
    const image1 = "";
    const image2 = "";
    const image3 = "";

    const [images, setImages] = useState([])
    const [count, setCount] = useState(0);
    const [merged, setMerged] = useState(null);

    const getImages = async () => {
        console.log("getImages");
        try {
            const url = "http://deco3801-universally-challenged.uqcloud.net/getCreator?";
            const query = "bookId=70&pageId=0";
            let response = await fetch(url + query);
            if (response.ok) {
                console.log("successful response");
                let data = await response.json();
                console.log(data.length);

                const roles = ["background", "illustrator", "writer"];
                let temp = ["", "", ""];
                for (let i = 0; i < data.length; i++) {
                    for (let r = 0; r < roles.length; r++) {
                        if (data[i].role === roles[r]) {
                            temp[r] = data[i].canvas;
                        }
                    }
                }
                console.log(temp);
                setImages(temp);
            } else {
                console.log("response not ok");
            }
        } catch (error) {
            console.error(error);
        }
    }

    const merge = () => {
        console.log("merge");
        RNImageTools.merge([
            images[0],
            images[1],
            images[2],
        ]).then(mergedImage => {
            console.log("finished\n" + typeof mergedImage);
            setMerged(mergedImage);
        }).catch(console.error);
    }

    return (
        <View style={{flex: 1}}>
            <View style={{flexDirection: "row"}}>
                <TouchableOpacity
                    style={canvas.button}
                    onPress={() => getImages()}
                >
                    <Text style={{fontSize: 20}}>getImages</Text>
                </TouchableOpacity>
                <TouchableOpacity
                    style={canvas.button}
                    onPress={() => merge()}
                >
                    <Text style={{fontSize: 20}}>merge</Text>
                </TouchableOpacity>
            </View>
            <View style={{flex: 1, flexDirection: "row"}}>
                {!images.empty ? (
                    <Image
                        source={{uri: "data:image/png;base64," + images[0]}}
                        style={{height: 400, width: 400}}/>
                ) : null}
                {!images.empty ? (
                    <Image
                        source={{uri: "data:image/png;base64," + images[1]}}
                        style={{height: 400, width: 400}}/>
                ) : null}
                {!images.empty ? (
                    <Image
                        source={{uri: "data:image/png;base64," + images[2]}}
                        style={{height: 400, width: 400}}/>
                ) : null}
            </View>
            {merged != null ? (
                <Image source={{merged}}
                       style={{height: 400, width: 400}}/>
            ) : null}
        </View>
    )
}

export default MergeImages;
